import React, { useEffect, useState } from 'react';
import './LevelPage.css';

const LevelPage = () => {
  const [headerExpand, setHeaderExpand] = useState(false);
  const [buttons, setButtons] = useState([1, 2, 3, 4, 5, 6, 7, 8]);

  useEffect(() => {
    setTimeout(() => {
      setHeaderExpand(true);
    }, 100);
  }, []);

  const handleButtonClick = (index) => {
    // Удаляем кнопку по индексу
    setButtons(buttons.filter((_, i) => i !== index));
  };

  return (
    <div className="level-home">
      <div className={`level-header ${headerExpand ? 'level-header-expand' : ''}`}>
        <div className="level-stars"></div>
        <h1>Level Page</h1>
      </div>

      <div className="button-container">
        {buttons.map((button, index) => (
          <button
            key={index}
            className={`circle-button size-${index + 1}`}
            onClick={() => handleButtonClick(index)}
          >
            {button}
          </button>
        ))}
      </div>
    </div>
  );
};

export default LevelPage;
